var levelOrder = function (root) {
    let res = [];
    const q = [];
    if (root !== null) {
        q.push(root);
    }
    while (q.length) {
        const current = q.shift();
        current.left && q.push(current.left);
        current.right && q.push(current.right);
        res.push(current.val);
    }
    return res;
};
`,paraId:56,tocIndex:14},{value:"\u5251\u6307 Offer 32 - II. \u4ECE\u4E0A\u5230\u4E0B\u6253\u5370\u4E8C\u53C9\u6811 II",paraId:0},{value:"easy",paraId:57,tocIndex:14},{value:"\u601D\u8DEF(\u5C42\u5E8F\u904D\u5386)",paraId:58,tocIndex:15},{value:"\u5728\u6BCF\u6B21while\u5FAA\u73AF\u5F00\u59CB\u4E4B\u524D\uFF0C\u627E\u51FA\u5F53\u524D\u5C42\u7EA7\u7684size",paraId:58,tocIndex:15},{value:"\u7136\u540E\u4F7F\u7528for\u5FAA\u73AF\u628A\u5F53\u524D\u5C42\u7EA7\u7684val\u5B58\u653E\u5728level\u7684\u6570\u7EC4\u4E2D\uFF0C\u4E2D\u95F4\u9047\u5230\u4E0B\u4E00\u5C42\u7684\u8282\u70B9\u8981\u653E\u5165\u961F\u5217\u4E2D",paraId:58,tocIndex:15},{value:"\u5F53for\u5FAA\u73AF\u7ED3\u675F\uFF0C\u8868\u793A\u5F53\u524D\u5C42\u7684\u503C\u5DF2\u7ECF\u641C\u96C6\u5230level\u4E2D\uFF0Cpush\u5230res\u4E2D\u5373\u53EF",paraId:58,tocIndex:15},{value:"\u8DDF",paraId:58,tocIndex:15},{value:"102 \u9898",paraId:59,tocIndex:15},{value:"\u76F8\u540C",paraId:58,tocIndex:15},{value:`/**
 * @param {TreeNode} root
 * @return {number[][]}
 */
var levelOrder = function (root) {
    const q = [];
    if (root !== null) {
        q.push(root);
    }
    const res = [];
    while (q.length) {
        const size = q.length;
        let level = [];
        for (let i = 0; i < size; i++) {
            const current = q.shift();
            level.push(current.val);
            current.left && q.push(current.left);
            current.right && q.push(current.right);
        }
        res.push(level);
    }

    return res;
};
`,paraId:60,tocIndex:15},{value:"\u5251\u6307 Offer 32 - III.\u4ECE\u4E0A\u5230\u4E0B\u6253\u5370\u4E8C\u53C9\u6811III",paraId:0},{value:"medium",paraId:61,tocIndex:15},{value:"\u601D\u8DEF",paraId:62,tocIndex:16},{value:"\u8DDF",paraId:62,tocIndex:16},{value:"\u5251\u6307 Offer 32 - II. \u4ECE\u4E0A\u5230\u4E0B\u6253\u5370\u4E8C\u53C9\u6811 II",paraId:63,tocIndex:16},{value:"\u76F8\u4F3C",paraId:62,tocIndex:16},{value:"\u5728\u5C42\u5E8F\u904D\u5386\u7684\u57FA\u7840\u4E0A\uFF0C\u6539\u53D8\u63A8\u5165level\u7684\u987A\u5E8F\u5373\u53EF",paraId:62,tocIndex:16},{value:"\u4F7F\u7528levelFlag\u53D8\u91CF\uFF0C\u4EA4\u66FFpush\u548Cunshift\u7684\u63A8\u5165\u65B9\u5F0F",paraId:62,tocIndex:16},{value:`/**
 * @param {TreeNode} root
 * @return {number[][]}
 */
var levelOrder = function (root) {
    const q = [];
    if (root !== null) {
        q.push(root);
    }

    const res = [];
    let levelFlag = true;
    while (q.length) {
        const size = q.length;
        const level = [];
        for (let i = 0; i < size; i++) {
            const current = q.shift();
            if (levelFlag) {
                level.push(current.val);
            } else {
                level.unshift(current.val);
            }
            current.left && q.push(current.left);
            current.right && q.push(current.right);
        }
        levelFlag = !levelFlag;
        res.push(level);
    }

    return res;
};
